import './App.css';
import Header from './component/header/Header'
import { BrowserRouter, Route, Switch} from 'react-router-dom'

function App() {
  return (

    <BrowserRouter>

      <div className="App">

        <Switch>
          <Header />
        </Switch>      


      </div>

    </BrowserRouter>

  );
}

export default App;
